import React from 'react';
import {Link} from 'react-router-dom';
import {Typography} from '@mui/material';

const User = ({
   name,
   avatar,
   userId,
}) => {

  return (
      <Link to={`/user/${userId}`} className="homeUser">
          <img src={avatar} alt={name}/>
          <Typography>{name}kl</Typography>
      </Link>
  )
}

export default User
